// https://leetcode.com/problems/valid-palindrome-ii/
/*
Given a non-empty string s, you may delete at most one character.
Judge whether you can make it a palindrome.

Example 1:
Input: "aba"
Output: True
Example 2:
Input: "abca"
Output: True
Explanation: You could delete the character 'c'.
Note:
The string will only contain lowercase characters a-z.
The maximum length of the string is 50000.
*/
func validPalindrome(s string) bool {
	for i := 0; i < len(s)/2; i++ {
		if s[i] != s[len(s)-1-i] {
			return (isPalindrome(s, i+1, len(s)-1-i) || isPalindrome(s, i, len(s)-1-i-1))
		}
	}
	return true
}

func isPalindrome(s string, i int, j int) bool {
	for k := i; k <= i+(j-i)/2; k++ {
		if s[k] != s[j-k+i] {
			return false
		}
	}
	return true
}

// Brute Force  LTE for
func validPalindrome(s string) bool {
	if isPalindrome(s) == true {
		return true
	} else {
		for i := 0; i < len(s); i++ {
			sub := s
			if i == 0 {
				sub = s[1:]
			} else if i == len(s)-1 {
				sub = s[:(len(s) - 1)]
			} else {
				sub = s[0:i] + s[(i+1):]
			}
			if isPalindrome(sub) == false {
				return false
			}
		}
	}
	return true
}

func isPalindrome(s string) bool {
	start := 0
	end := len(s) - 1
	for start < end {
		if s[start] != s[end] {
			return false
		}
		start++
		end--
	}
	return true
}

